import React from "react";
import { Footer, Navbar } from "../../../home/nav&foot&contact&about/navbar";
import { Link } from "react-router-dom";
import { Comp } from "../../asidebar/asidebar";
import { useState,useEffect } from "react";
import axios from "axios";
import Payment from '../unitmanage/payment/payment'
export const Unitmanage=()=>
{
    const [dat,sdat]=useState([]);
    const [pymt,spymt]=useState([]);
    const Approval_pend=async()=>
    {
        document.getElementById('').style.display="";
    }
    const Approved=async()=>
    {
        document.getElementById('').style.display="";
    }
    useEffect(() => {
        axios.get("http://localhost:8000/aufl")
            .then((result) => {
                sdat(result.data)
            })
        axios.get("http://localhost:8000/pymtretrive")
        .then((result1)=>
        {
            spymt(result1.data)
        })
    }, [])
    return(
        <>
        <Navbar/>
        <div className="home">
            <div className="adpage">
                <Comp/>
                <section>
                    <div className="unitreq">
                        <Link className="unitreqitem" onClick={Approval_pend}>Approval Pending</Link>
                        <Link className="unitreqitem" onClick={Approved}>Approved</Link>
                    </div>
                    <div>
                    <div className="editdis" style={{display:'none'}}><Payment/></div>
                    <div className="editdis" style={{display:'none'}}></div>
                    </div>
                </section>
            </div>
        </div>
        <Footer/>
        </>
    )
}
